import React, { Component } from 'react';
import ButtonComponent from "./customBtn";

class ImageComponent extends ButtonComponent {
    render() {
        return (
            <div>
                <img src="http://localhost:4000/load?id=1" alt="display image" />
            </div>
        );
    }
}

export default ImageComponent;
